import './App.css'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Switch>
      <Route exact path="/">
        <Home></Home>
      </Route>

      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App
